import React from 'react'

export default function EndItem(props) {
    return (
        <>
            <div className = "end-block">
                {props.arrowValues.map((score) => {
                    return <p>{score}</p>
                })}
            </div>
            <div className = "endScore">
                {props.endScore}
            </div>
            <div className = "totalScore">
                {props.totalScore}
            </div>
        </>
    )
}
